import React from 'react'
import { Text, View } from 'react-native'

const Main = () => {
  return (
    <View style={{ flex: 1, backgroundColor: 'black' }}>
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text style={{ color: 'red' }}>Estoy en el main</Text>
      </View>
    </View>
  )
}

export default Main
